import React from 'react';
import { Link } from 'react-router-dom';
import NavItem from './NavItem.jsx';
import '../../styles/navbar.css';
import LogoutButton from './LogoutButton.jsx';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-main">
        <Link className="navbar-brand" to="/">FINEbank.IO</Link>
        <ul className="navbar-nav">
          <NavItem to="/overview" icon={homeIcon}>Overview</NavItem>
          <NavItem to="/balances" icon={homeIcon}>Balances</NavItem>
          <NavItem to="/transactions" icon={homeIcon}>Transactions</NavItem>
          <NavItem to="/bills" icon={homeIcon}>Bills</NavItem>
          <NavItem to="/expenses" icon={homeIcon}>Expenses</NavItem>
          <NavItem to="/goals" icon={homeIcon}>Goals</NavItem>
          <NavItem to="/settings" icon={homeIcon}>Settings</NavItem>
        </ul>
      </div>
      <div className="navbar-footer">
      <LogoutButton logo="/path/to/your/logo.png" />
        <div className="user-profile">
          <Link to="/user">Tanzir Rahman</Link>
          <small>View profile</small>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
